styles:
  :host {
  display: block;
  height: 100px;
  width: 100px;
  overflow: hidden;
}
:host svg {
  height: 100%;
  width: 100%;
  -webkit-transform-origin: center;
          transform-origin: center;
}
:host path {
  fill: transparent;
  stroke-width: 2px;
  stroke: white;
}
:host[mode='indeterminate'] svg {
  -webkit-animation-duration: 5250ms, 2887.5ms;
          animation-duration: 5250ms, 2887.5ms;
  -webkit-animation-name: md-progress-circle-sporadic-rotate, md-progress-circle-linear-rotate;
          animation-name: md-progress-circle-sporadic-rotate, md-progress-circle-linear-rotate;
  -webkit-animation-timing-function: ease-in-out, linear;
          animation-timing-function: ease-in-out, linear;
  -webkit-animation-iteration-count: infinite;
          animation-iteration-count: infinite;
  -webkit-transition: none;
  transition: none;
}

@-webkit-keyframes md-progress-circle-linear-rotate {
  0% {
    -webkit-transform: rotate(0deg);
            transform: rotate(0deg);
  }
  100% {
    -webkit-transform: rotate(360deg);
            transform: rotate(360deg);
  }
}

@keyframes md-progress-circle-linear-rotate {
  0% {
    -webkit-transform: rotate(0deg);
            transform: rotate(0deg);
  }
  100% {
    -webkit-transform: rotate(360deg);
            transform: rotate(360deg);
  }
}
@-webkit-keyframes md-progress-circle-sporadic-rotate {
  12.5% {
    -webkit-transform: rotate(135deg);
            transform: rotate(135deg);
  }
  25% {
    -webkit-transform: rotate(270deg);
            transform: rotate(270deg);
  }
  37.5% {
    -webkit-transform: rotate(405deg);
            transform: rotate(405deg);
  }
  50% {
    -webkit-transform: rotate(540deg);
            transform: rotate(540deg);
  }
  62.5% {
    -webkit-transform: rotate(675deg);
            transform: rotate(675deg);
  }
  75% {
    -webkit-transform: rotate(810deg);
            transform: rotate(810deg);
  }
  87.5% {
    -webkit-transform: rotate(945deg);
            transform: rotate(945deg);
  }
  100% {
    -webkit-transform: rotate(1080deg);
            transform: rotate(1080deg);
  }
}
